sys_variable_value.value:
(function parse(inputs, outputs) {
    var response = JSON.parse(inputs.sourceItem);
    outputs.targetObject.number=response.number;   
    outputs.targetObject.title=response.title;
    outputs.targetObject.state=response.state;
    outputs.targetObject.description=response.description; 
})(inputs, outputs)

